import {
  Button,
  ErrorMessage,
  Input,
  Label,
  Page,
  Wrapper,
} from "src/commonStyles";
import { Box, Container, Content, Form, Inner, Title } from "./styled";
import { useForm, SubmitHandler } from "react-hook-form";
import { useNavigate } from "react-router-dom";

interface IFormInput {
  name: string;
  surname: string;
  email: string;
  login: string;
  password: string;
  passwordConfirm: string;
  manager: boolean;
}

export default function Register() {
  const navigate = useNavigate();

  const {
    register,
    formState: { errors },
    handleSubmit,
    reset,
  } = useForm<IFormInput>();

  const onSubmit: SubmitHandler<IFormInput> = (data) => {
    console.log(data);
    reset({
      name: "",
      surname: "",
      email: "",
      login: "",
      password: "",
      passwordConfirm: "",
      manager: false,
    });
    return navigate("/home");
  };

  const goToRegistr = () => navigate("/registration");


  return (
    <Page>
      <Content>
        <Wrapper className="width100proc">
          <Title>Регистрация</Title>
          <Form onSubmit={handleSubmit(onSubmit)}>
            <Box>
              <Label htmlFor="name">Имя</Label>
              <Inner>
                <Input
                  {...register("name", {
                    required: { value: true, message: "Введите имя" },
                    pattern: {
                      value: /^[A-Za-zА-Яа-я]+$/,
                      message: "Только буквы",
                    },
                    maxLength: { value: 50, message: "Максимум 50 букв" },
                  })}
                  placeholder="Имя"
                  $width="350px"
                  autoComplete="off"
                  id="name"
                />
                <ErrorMessage>{errors.name?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box>
              <Label htmlFor="surname">Фамилия</Label>
              <Inner>
                <Input
                  {...register("surname", {
                    required: { value: true, message: "Введите фамилию" },
                    pattern: {
                      value: /^[A-Za-zА-Яа-я]+$/,
                      message: "Только буквы",
                    },
                    maxLength: { value: 50, message: "Максимум 50 букв" },
                  })}
                  placeholder="Фамилия"
                  $width="350px"
                  autoComplete="off"
                  id="surname"
                />
                <ErrorMessage>{errors.surname?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box>
              <Label htmlFor="email">Почта</Label>
              <Inner>
                <Input
                  {...register("email", {
                    required: { value: true, message: "Введите почту" },
                    pattern: {
                      value: /^[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4}$/,
                      message: "Формат: xxx@yyy.zzz",
                    },
                  })}
                  placeholder="Почта"
                  $width="350px"
                  autoComplete="off"
                  id="email"
                />
                <ErrorMessage>{errors.email?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box>
              <Label htmlFor="login">Логин</Label>
              <Inner>
                <Input
                  {...register("login", {
                    required: { value: true, message: "Введите логин" },
                    pattern: {
                      value: /^[A-Za-z0-9]+$/,
                      message: "Только латинские буквы и цифры",
                    },
                    maxLength: { value: 50, message: "Максимум 50 знаков" },
                  })}
                  placeholder="Логин"
                  $width="350px"
                  autoComplete="off"
                  id="login"
                />
                <ErrorMessage>{errors.login?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box>
              <Label htmlFor="password">Пароль</Label>
              <Inner>
                <Input
                  {...register("password", {
                    required: { value: true, message: "Введите пароль" },
                    pattern: {
                      value: /^[A-Za-z0-9]+$/,
                      message: "Только латинские буквы и цифры",
                    },
                    maxLength: { value: 50, message: "Максимум 50 знаков" },
                  })}
                  placeholder="Пароль"
                  $width="350px"
                  autoComplete="off"
                  id="password"
                />
                <ErrorMessage>{errors.password?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box>
              <Label htmlFor="passwordConfirm">Подтвердите пароль</Label>
              <Inner>
                <Input
                  {...register("passwordConfirm", {
                    required: { value: true, message: "Подтвердите пароль" },
                  })}
                  placeholder="Подтвердите пароль"
                  $width="350px"
                  autoComplete="off"
                  id="passwordConfirm"
                />
                <ErrorMessage>{errors.passwordConfirm?.message}</ErrorMessage>
              </Inner>
            </Box>
            <Box $width="430px" $checkbox>
              <Label htmlFor="manager" $checkbox>
                Вы менеджер?
              </Label>
              <Input
                {...register("manager")}
                $width="35px"
                $height="35px"
                autoComplete="off"
                id="manager"
                type="checkbox"
              />
            </Box>
            <Container>
              <Button $width="126px" $white>
                Войти
              </Button>
              <Button type="submit" $width="210px">
                Регистрация
              </Button>
            </Container>
          </Form>
        </Wrapper>
      </Content>
    </Page>
  );
}
